import React from 'react';
import { Link } from 'react-router-dom';

function Login() {
  return (
    <div>
      <h1>Login</h1>
      <Link to="/patient-dashboard">
        <button>Patient Login</button>
      </Link>
      <Link to="/doctor-dashboard">
        <button>Doctor Login</button>
      </Link>
    </div>
  );
}

export default Login;
